import React from "react";
import "../css/home.css";
import Grid from "@material-ui/core";

const Home = () => {
    return (
        <>
            <Grid container className="computer">
                <div className="computer">
                    <h1 className="title">Maxence</h1>
                    <h1 className="title">Liboz</h1>
                </div>
            </Grid>
        </>
    );
};

export default Home;
